import React from "react";
import { Link } from 'react-router-dom';
import "./DonorOrNGO.css"
function DonorOrNGO() {
  return (
    <div className="what-are-you">
      <h1>SIGN UP:</h1>
      <Link to='/auth'><button className="btn">DONOR</button></Link>
      <button className="btn">NGO / INDIVIDUAL</button>
      <h1>LOGIN:</h1>
      <button className="btn">DONOR</button>
      <button className="btn">NGO / INDIVIDUAL</button>
    </div>
  );
}
export default DonorOrNGO;
